drop table if exists employee;

create table employee (
    id BIGSERIAL not null primary key ,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	gender VARCHAR(50),
	email VARCHAR(50),
	data_of_birth DATE,
	county_of_birth VARCHAR(50)
);

SELECT first_name FROM employee;

select * from employee;

select first_name, last_name FROM employee;

select email from employee;

select * from employee order by county_of_birth;

select * from employee order by county_of_birth desc ;

select * from employee order by email desc ;

select county_of_birth from employee order by county_of_birth;

select distinct county_of_birth from employee order by county_of_birth;

select * from employee where gender = 'Female';

select * from employee where gender = 'Female' and county_of_birth = 'Argentina';

select * from employee where gender = 'Female' and (county_of_birth = 'Czech Republic' or county_of_birth = 'Poland');

select * from employee limit 20 ;

select * from employee offset 10 limit 5;

select * from employee offset 10 fetch first 5 row only ;

select * from employee where county_of_birth in ( 'Uzbekistan', 'China', 'Russia');

select * from employee where data_of_birth between '2021-01-01' and '2021-05-05';

select * from employee where email like '%.com';

select * from employee where email like '%@google.%';

select * from employee where county_of_birth ilike 'p%';

select county_of_birth, count(*) from employee group by county_of_birth;

select first_name, count(*) from employee group by first_name;

select county_of_birth, count(*) from employee group by county_of_birth having count(*) > 10 order by county_of_birth desc ;

select first_name as name, last_name as surname, gender as sex, email, data_of_birth, county_of_birth from  employee;

select coalesce(email, 'not applicable') from employee;

select first_name from employee;



